Okay, so I need to create a Tooltip component in NextJS using React Context. The main requirement is that when a user clicks on a Tooltip, any previously opened Tooltip should close. Since these Tooltips are used in different places but don't share a parent context, they need to be aware of each other through some global state. Hmm, React Context seems like the right approach here because it allows state to be shared across components without passing props manually.

First, I should set up a context that manages the state of the currently open Tooltip. Let's call it TooltipContext. The context should keep track of the active Tooltip's ID, and provide a function to set the active ID. Each Tooltip component will have a unique ID, so when one is clicked, it sets its ID as the active one in the context. If another Tooltip was already open, its ID will be replaced, and it should close.

Wait, but how do the individual Tooltip components know to close when the active ID changes? Each Tooltip should check if its own ID matches the active ID in the context. If not, it should close. So the Tooltip component will consume the context and use the active ID to determine if it's open or not.

Let me outline the steps:

1. Create a TooltipContext using React.createContext. This context will hold the activeTooltipId and a setter function.

2. Create a TooltipProvider component that wraps the application or the part where Tooltips are used. This provider will manage the state (activeTooltipId) and provide the setter function via context.

3. Each Tooltip component should use the useContext hook to access the activeTooltipId and the setter. When a Tooltip is clicked, it calls the setter with its own ID. If it's already active, maybe set it to null to close.

4. The Tooltip component's visibility should depend on whether its ID matches the activeTooltipId from the context.

But wait, how do we generate unique IDs for each Tooltip? Maybe the user of the Tooltip component can pass an ID prop, but that might be error-prone if they forget. Alternatively, we can generate a unique ID automatically when the Tooltip is mounted. Using useId from React might help here, but that's available in React 18. Since NextJS uses React 18, that's okay. So each Tooltip can generate its own unique ID with useId.

Wait, but if the ID is generated internally, how can the context track it? Because the context needs to know which ID is active. So when a Tooltip is clicked, it sets the active ID to its own generated ID. Then, any other Tooltip that's open (with a different ID) will see that the active ID is not theirs and close.

