## Che cos'è un file IPA?
Un file con estensione .ipa appartiene a iOS ed è noto come file pacchetto applicazione. Questo è un file di archivio (compresso utilizzando la compressione [ZIP](/it/compression/zip/)) che archivia un'app iOS, ma tale app può essere installata solo su un dispositivo iOS o macOS basato su ARM. In genere, l'IPA contiene un file binario per l'architettura ARM per i dispositivi mobili iOS e un file binario per l'architettura x86 per il simulatore iOS. La maggior parte degli IPA è crittografata con Apple FairPlay DRM.

## Formato file IPA
Gli sviluppatori iOS che sviluppano app utilizzando Apple Xcode sono ben consapevoli dei file IPA perché devono creare questi file per testare le loro app per scopi di distribuzione. Sebbene l'App Store sia il modo noto per distribuire le app iOS, gli sviluppatori possono utilizzare anche i file IPA per distribuire le app in modo informale. I file IPA devono essere firmati con un certificato di distribuzione che consente di installarli solo sui dispositivi specificati.
