Yes, Shopify provides an API for currency conversion through the Storefront API. You can use the `moneyFormat` and `presentmentCurrencyRate` fields to handle currency conversions. However, if you need real-time exchange rates, you might need to use a third-party service like Open Exchange Rates or Fixer.io, as Shopify's built-in rates might not be real-time. Here's an example of how to fetch the presentment currency rates using the Storefront API:

```graphql
query {
  shop {
    paymentSettings {
      currencyCode
      enabledPresentmentCurrencies
    }
  }
  currency {
    presentmentCurrencyRate(currency: EUR) {
      rate
    }
  }
}
```

This query fetches the enabled currencies and the exchange rate for EUR. Adjust the currency code as needed. For more dynamic or real-time rates, consider integrating an external API.
